import React from "react";
import { useNavigate } from "react-router-dom";
import "../css/join.css";

const Join = () => {
  const navigate = useNavigate(); // 페이지 이동에 사용
  const [isDuplicateChecked, setIsDuplicateChecked] = useState(false); // 중복 확인 상태 관리

  // 중복 확인 버튼 클릭
  const handleDuplicateCheck = () => {
    // 중복 확인 로직 (추후 백엔드 연동 필요)
    setIsDuplicateChecked(true);
  };

  // 로그인 페이지로 이동
  const handleGoToLogin = () => {
    navigate("/"); // 로그인 페이지로 이동
  };

  return (
    <div className="signup-container">
      <div className="signup-form">
        {/* 로고 */}
        <img src={SubLogo} alt="면접MATE" className="logo" />

        {/* 회원가입 제목 */}
        <h2>회원가입</h2>

        {/* 회원가입 입력 폼 */}
        <form>
          <input type="email" placeholder="Email" required />
          <div className="nickname-field">
            <input type="text" placeholder="NickName" required />
            <button
              type="button"
              onClick={handleDuplicateCheck}
              className={`duplicate-check-button ${
                isDuplicateChecked ? "checked" : ""
              }`}
            >
              {isDuplicateChecked ? "확인완료" : "중복확인"}
            </button>
          </div>
          <input type="password" placeholder="Password" required />
          <input type="password" placeholder="Check password" required />
          <button type="submit" className="signup-button">
            서비스 이용하기
          </button>
        </form>

        {/* 로그인 페이지로 돌아가기 버튼 */}
        <button onClick={handleGoToLogin} className="go-to-login-button">
          로그인으로 돌아가기
        </button>
      </div>
    </div>
  );
};

export default Join;
